  return (
    <div>
      <h1>Hello World</h1>
      <nav style={{ borderBottom: "solid 1px", paddingBottom: "1rem" }}>
        <Link to="/recipes">Recipes</Link>
        <Link to="/about">About</Link>
      </nav>
    </div>
  );
}

export default App;
